import React from 'react';
import { Layout, Header, Content } from 'react-mdl';
import Main from './components/main';
import './App.css';

function App() {
  return (
      <div className="demo-big-content">
        <Layout>
            <Header transparent scroll title="TEST">
            </Header>
            <Content>
              <div className="page-content" />
              <Main /> 
            </Content>
        </Layout>
      </div>    
  );
}

export default App;
